class VendorModel {  List<VendorItem> list=[];  VendorModel(this.list);  factory VendorModel.fromJson(Map json){    return	VendorModel(List.from(json['Vendors']).map((item)=>VendorItem.fromJson(item)).toList());  }}class BrandsModel {  List<VendorItem> list=[];  BrandsModel(this.list);  factory BrandsModel.fromJson(Map json){    return	BrandsModel(List.from(json['Manufacturers']).map((item)=>VendorItem.fromJson(item)).toList());  }}class VendorItem{  String image;  String id;  String name;  VendorItem(this.image, this.id, this.name);  factory VendorItem.fromJson(Map<String,dynamic> json){    return VendorItem(json['PictureUrl'],json['Id'],json['Name']);  }}